import React, { Component } from 'react'

export default class Map extends Component {
    render() {
        const { list, render} = this.props
        return (
            <div>
                {list.map((item, index) => {

                    if (render) {
                        return render(item, index)
                    }
                        return (
                            <li key={item.id}>
                                <h1>{item.tittle}</h1>
                                <h3>{item.region}</h3>
                            </li>
                        )
                })}
            </div>
        )
    }
}
